from typing import List
from functools import lru_cache, cache

class Solution:
    def maxSelectedElements(self, nums: List[int]) -> int:
        # 朴素做法：先将nums排序，假设nums绘制在一副图上成为一根曲线，
        # 再在这张图上画一根向上偏移1的曲线，现在问题转化为如何通过连接两根曲线上的点
        # 从而获得最长连续数组
        if len(nums) <= 1: return 1
        nums.sort()
        # for i in range(1, len(nums)):
        #     if nums[i] - nums[i-1] == 1:
        @lru_cache(None)
        def dfs(start, end, add):
            if end == len(nums)-1: return 1 # modify
            ret = 1
            if nums[end] + add + 1 == nums[end+1]:
                ret = max(1 + dfs(start, end+1, 0), ret)

            if nums[end] + add == nums[end+1]:
                ret = max(1 + dfs(start, end+1, 1), ret)
            
            ret3 = dfs(end+1, end+1, 1)
            ret4 = dfs(end+1, end+1, 0)            
            ret = max([ret, ret3, ret4])
            return ret
        
        rrrr = max(dfs(0, 0, 0), dfs(0, 0, 1))
        return rrrr

    def maxSelectedElements(self, nums: List[int]) -> int:
        if len(nums) <= 1: return 1
        dp = {}
        nums.sort()
        # for i in range(1, len(nums)):
        #     if nums[i] - nums[i-1] == 1:
        # @lru_cache(None)
        def dfs(start, end, add):
            if end == len(nums)-1: return 1 # modify
            ret = 1
            ret11 = 1
            if nums[end] + add + 1 == nums[end+1]:
                r_v = dp[(start, 0)] if (start, 0) in dp else dfs(start, end+1, 0)
                dp[(start, 0)] = r_v
                ret = max(1 + r_v, ret)

            if nums[end] + add == nums[end+1]:
                r_v = dp[(start, 1)] if (start, 1) in dp else dfs(start, end+1, 1)
                dp[(start, 1)] = r_v
                ret = max(1 + r_v, ret)

            ret11 = max(ret11, ret)

            ret3 = dp[(end+1, 0)] if (end+1, 0) in dp else dfs(end+1, end+1, 0)
            ret4 = dp[(end+1, 1)] if (end+1, 1) in dp else dfs(end+1, end+1, 1)
            if ret3 > ret4:
                ret22 = ret3
                dp[(end+1, 0)] = ret3
            else:
                ret22 = ret4
                dp[(end+1, 1)] = ret4
            
            return max(ret11, ret22)
            
        rrrr = max(dfs(0, 0, 0), dfs(0, 0, 1))
        return rrrr

